import React from "react";
import LogoP from "./logoP.png";
const Footer = () => {
  return (
    <footer className="footer bg-white">
      <img
        src={LogoP}
        width="100"
        height="30"
        className="d-inline-block align-top"
      />
    </footer>
  );
};
export default Footer;
